import AppBar from './AppBar/AppBar'
const Wrapper = styled('div')({
    width: '100%',
    height: '100vh',
    display: 'flex',

})

const Dashboard = () => {

    useEffect(() => {
        const userDetails = localStorage.getItem("user")
        if( !userDetails ) {
            window.location.pathname = "login"
        }
    },[])

    return (
       <Wrapper>

<SideBar/>
<FriendsSideBar/>
<Messenger/>
<AppBar/>
       </Wrapper>
    )
}

export default Dashboard
